# ====================== VISIT / DOWNLOAD COUNTERS ======================
def read_count_file(path, default=0):
    if not os.path.exists(path):
        return default
    try:
        with open(path, "r") as f:
            return int(f.read().strip() or 0)
    except Exception:
        return default

def write_count_file(path, value):
    with open(path, "w") as f:
        f.write(str(int(value)))

def update_visit_count():
    count_file = "counter.txt"
    count = read_count_file(count_file, 0)
    if "counted" not in st.session_state:
        count += 1
        write_count_file(count_file, count)
        st.session_state.counted = True
    return count

def update_download_count():
    count_file = "downloads.txt"
    count = read_count_file(count_file, 0)
    count += 1
    write_count_file(count_file, count)
    return count

def get_download_count():
    return read_count_file("downloads.txt", 0)

visit_count = update_visit_count()
download_total = get_download_count()

# ====================== DECRYPT AND LOAD STUDENT FILE ======================
def load_student_file():
    """
    """

    encrypted_file = AES_FILE
    decrypted_file = "Students_List.xlsx"
    try:
        if not os.path.exists(encrypted_file):
            st.error(f"Encrypted student file not found: {encrypted_file}")
            return None

        # Decrypt the file to local decrypted_file
        with open(encrypted_file, "rb") as f_in:
            # write decrypted bytes to temporary file
            with open(decrypted_file, "wb") as f_out:
                # IMPORTANT: do NOT pass file length parameter (deprecated)
                pyAesCrypt.decryptStream(f_in, f_out, AES_PASSWORD, BUFFER_SIZE)

        # Ensure the decrypted file exists and has content
        if not os.path.exists(decrypted_file):
            st.error("❌ Decryption failed: decrypted file not created.")
            return None
        size = os.path.getsize(decrypted_file)
        if size == 0:
            st.error("❌ Decrypted file is empty. Check AES password or encrypted file.")
            return None

        # Now read the Excel file safely
        df = pd.read_excel(decrypted_file)
        st.success("✅ Student list decrypted and loaded successfully.")
        return df

    except Exception as e:
        st.error(f"❌ Failed to load student file: {e}")
        return None

# ====================== GITHUB PROGRESS UPDATE (simple) ======================
def update_progress_on_github(student_reg, subject_id, progress_data):
    """
    progress_data: dict to store/update in remote PROGRESS_FILE (JSON)
    This is a simple implementation that sends a PUT or PATCH via GitHub API.
    Note: Streamlit secrets must provide a token with repo access.
    """
    try:
        token = GITHUB_TOKEN
        repo = REPO
        path = PROGRESS_FILE
        api = "https://api.github.com"
        headers = {"Authorization": f"token {token}", "Accept": "application/vnd.github.v3+json"}

        # Get current file (if exists)
        get_url = f"{api}/repos/{repo}/contents/{path}"
        r = requests.get(get_url, headers=headers)
        new_content_bytes = base64.b64encode(str(progress_data).encode("utf-8")).decode("utf-8")
        commit_message = f"update progress for {student_reg} {subject_id} at {datetime.utcnow().isoformat()}"

        if r.status_code == 200:
            # Update existing file
            sha = r.json()["sha"]
            payload = {"message": commit_message, "content": new_content_bytes, "sha": sha}
            put_r = requests.put(get_url, headers=headers, json=payload)
            return put_r.ok
        elif r.status_code == 404:
            # Create new file
            payload = {"message": commit_message, "content": new_content_bytes}
            put_r = requests.put(get_url, headers=headers, json=payload)
            return put_r.ok
        else:
            # Some other error
            return False
    except Exception:
        return False

# ====================== CERTIFICATE GENERATION ======================
def create_certificate_pdf(name: str, reg_no: str, subject: str, output_path: str):
    """
    Simple certificate generator using FPDF. Saves PDF to output_path.
    """
    pdf = FPDF(orientation="L", unit="mm", format="A4")
    pdf.add_page()
    pdf.set_auto_page_break(False)
    # Background or border
    pdf.set_draw_color(0, 0, 0)
    pdf.rect(5, 5, 287, 200)  # border

    pdf.set_font("Arial", "B", 28)
    pdf.cell(0, 30, ln=1)  # spacer

    pdf.set_font("Arial", "B", 32)
    pdf.cell(0, 12, "Certificate of Completion", align="C", ln=1)

    pdf.set_font("Arial", "", 18)
    pdf.ln(8)
    pdf.cell(0, 10, f"This is to certify that", align="C", ln=1)

    pdf.set_font("Arial", "B", 26)
    pdf.ln(4)
    pdf.cell(0, 12, f"{name}", align="C", ln=1)

    pdf.set_font("Arial", "", 18)
    pdf.ln(6)
    pdf.cell(0, 10, f"Registration No: {reg_no}", align="C", ln=1)
    pdf.ln(4)
    pdf.set_font("Arial", "", 16)
    pdf.multi_cell(0, 8, f"has successfully completed the microlearning session on '{subject}' on {datetime.utcnow().strftime('%Y-%m-%d')}.", align="C")

    pdf.ln(20)
    pdf.set_font("Arial", "", 12)
    pdf.cell(0, 8, "Authorized by: Course Coordinator", align="R")

    pdf.output(output_path)
    return output_path

def get_pdf_download_link(pdf_path):
    with open(pdf_path, "rb") as f:
        data = f.read()
    b64 = base64.b64encode(data).decode()
    href = f'<a href="data:application/octet-stream;base64,{b64}" download="{os.path.basename(pdf_path)}">📥 Download Certificate</a>'
    return href

# ====================== HELPER: find student ======================
def find_student(df, reg_no):
    """
    Find a student row by registration number.
    Accepts integer or string; compares after stripping spaces.
    """
    if df is None:
        return None
    key = str(reg_no).strip()
    # try common column names
    for col in df.columns:
        if col.lower() in ["reg", "regno", "registration", "registration_no", "registration number", "registrationno", "register_no", "id", "registration_number"]:
            try:
                found = df[df[col].astype(str).str.strip() == key]
                if not found.empty:
                    return found.iloc[0].to_dict()
            except Exception:
                continue
    # fallback: try the first column if nothing matched
    try:
        found = df[df[df.columns[0]].astype(str).str.strip() == key]
        if not found.empty:
            return found.iloc[0].to_dict()
    except Exception:
        pass
    return None

